import React from 'react';
import './Portfolio.css';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation } from 'swiper/modules'; // Import Navigation module
import 'swiper/css';
import 'swiper/css/navigation'; // Import Navigation styles

import AvsH from "../../img/AvsH.png";
import Directors1 from "../../img/Directors1.jpg";
import GAMING from "../../img/GAMING.jpg";
import Scary from "../../img/Scary.jpg";
import RichPoor from "../../img/RichPoor.jpg";
import Trumpp from "../../img/Trumpp.jpg";

export const Portfolio = () => {
    return (
        <div className="portfolio">
            <span>Recent Projects</span>
            <span>Thumbnails</span>

            <Swiper
                modules={[Navigation]} // Add Navigation module
                navigation // Enable navigation arrows
                spaceBetween={10}
                slidesPerView={3}
                grabCursor={true}
                className='portfolio-slider'
            >
                <SwiperSlide>
                    <img src={Scary} alt="Scary Project" />
                </SwiperSlide>
                <SwiperSlide>
                    <img src={AvsH} alt="AvsH Project" />
                </SwiperSlide>
                <SwiperSlide>
                    <img src={Directors1} alt="Directors Project" />
                </SwiperSlide>
                <SwiperSlide>
                    <img src={RichPoor} alt="Rich vs Poor Project" />
                </SwiperSlide>
                <SwiperSlide>
                    <img src={GAMING} alt="Gaming Project" />
                </SwiperSlide>
                <SwiperSlide>
                    <img src={Trumpp} alt="Trumpp Project" />
                </SwiperSlide>
            </Swiper>
        </div>
    );
}
